import React from 'react';
import logo from './logo.svg';
// import './App.css';
import SampleChoice from './components/SampleChoice';
import {
  BrowserRouter,
  Routes,
  Route
} from "react-router-dom";
import SampleChoiceWrapper from './components/SampleChoiceWrapper';

function App() {
  return (
    <BrowserRouter>
      Navbar>
      <Routes>
        <Route path="/" element={<App />} />
        <Route path="training" element={<SampleChoiceWrapper />} />
        <Route path="history" element={<SampleChoice />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
